  const [noteCollected, setNoteCollected] = useState(false);

  return (
    <TransitionWrapper>
      <div className="inside-cave-left-side--container">
        <Note
          paragraph="faktai apie mane"
          linkUrl="/inside-cave"
          notePostion={{
            margin: "0 6rem",
          }}
        />
      </div>
    </TransitionWrapper>
  );
};

export default LeftSide;
